import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from '../api';

function Navbar() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    fetchUserData();
  }, []);

  const fetchUserData = async () => {
    try {
      const response = await axios.get('/auth/user'); // Assuming this endpoint returns user data
      setUser(response.data);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  const navbarStyles = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#333',
    color: '#fff',
    padding: '1rem'
  };

  const logoStyles = {
  display: 'flex'
