    marginLeft: '0.5rem',
    fontFamily: 'Arial, sans-serif',
    fontSize: '1rem',
    fontWeight: 'bold',
    color: 'Yellow',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'

  };

  const linkStyles = {
    color: '#fff',
    textDecoration: 'none'
  };

  const userInfoStyles = {
    fontSize: '1rem',
    fontWeight: 'bold'
  };

  return (
    <nav style={navbarStyles}>
      <div style={logoStyles}>
        <span role="img" aria-label="Logo">
          ðŸš€
        </span>
        <div style={logoTextStyles}>Social Media App</div>
      </div>
      <ul>
        <li><Link to="/" style={linkStyles}>Home</Link></li>
        <li><Link to="/profile" style={linkStyles}>Profile</Link></li>
        <li><Link to="/login" style={linkStyles}>Login</Link></li>
        <li><Link to="/register" style={linkStyles}>Register</Link></li>
      </ul>
      {user && (
        <div style={userInfoStyles}>
          Welcome, {user.username}!
        </div>
      )}
    </nav>
  );
}

export default Navbar;
